package leetcode.algorithms;

import java.util.Objects;

/**
 * Description: 392. Is Subsequence
 *
 * @author Baltan
 * @date 2019-07-04 09:59
 */
public class IsSubsequence {
    public static void main(String[] args) {
        System.out.println(isSubsequence("aaaaaa", "bbaaaa"));
        System.out.println(isSubsequence("", "abc"));
        System.out.println(isSubsequence("abc", ""));
        System.out.println(isSubsequence("", ""));
        System.out.println(isSubsequence("abc", "ahbgdc"));
        System.out.println(isSubsequence("axc", "ahbgdc"));
        System.out.println(isSubsequence("leeeeetcode",
                ""));
    }

    public static boolean isSubsequence(String s, String t) {
        if (s == null || t == null) {
            return false;
        }

        if (!Objects.equals(s, "") && Objects.equals(t, "")) {
            return false;
        }

        int sLength = s.length();
        int tLength = t.length();
        int sIndex = 0;
        int tIndex = 0;
        char[] sChars = s.toCharArray();
        char[] tChars = t.toCharArray();

        while (sIndex < sLength) {
            /**
             * 从tIndex开始遍历t，是否找到s[sIndex]
             */
            boolean find = false;

            while (tIndex < tLength) {
                if (tChars[tIndex] != sChars[sIndex]) {
                    tIndex++;
                } else {
                    /**
                     * 找到了s[sIndex]，结束对s[sIndex]的查找
                     */
                    find = true;
                    tIndex++;
                    break;
                }
            }
            /**
             * 如果s[sIndex]没有找到，则说明s不是t的子序列，否则就机选查找s的下一个字符是否在t中存在
             */
            if (!find) {
                return false;
            } else {
                sIndex++;
            }
        }
        return true;
    }
}
